var Calculate = function(){
	product = $('#product').val();parameter = ($('#parameter').val());
	from = parseInt($('#from').val());to = parseInt($('#to').val());
	stepdiscount = (100-(parseFloat($('#stepdiscount').val())))/100;speedupdiscount = (100-(parseFloat($('#speedupdiscount').val())))/100;
	switch (product){
		case '':
			alert('Product missing...')
			highlight('#product', '#BA4027')
		break;
		default:
			switch (parameter){
				case '':
					alert($('#product').val() + "'s Attribute missing...");
					highlight('#parameter', '#BA4027')
				break;
				default:
					if(!Database.hasOwnProperty(product)){alert('Unkown Product...');highlight('#product', '#b76700');}
					else if (!Database[product].hasOwnProperty(parameter)){alert("Unknown M"+M_n+" "+$('#product').val()+"'s Attribute...");highlight('#parameter', '#b76700');}
					else if (!Database[product][parameter][M_n][0]){alert("The data for M"+M_n+" "+$('#product').val()+"'s "+$('#parameter').val()+" is not up to date. Please check back later or try another search.\n\nSorry for any inconvenience caused.");}
					else if (from === 0){alert('Range error! Start range cannot be 0');highlight('#from', '#BA4027');}
					else if (to === 0){alert('Range error! End range cannot be 0');highlight('#to', '#BA4027');}
					else {
						arraylength = Database[product][parameter][M_n].length;
						if(from > (arraylength)){alert('Range error! Start range['+from+'] cannot be greater than the maximum range['+(arraylength)+'].');highlight('#from', '#BA4027');}
						else if(to > (arraylength)){alert('Range error! End range['+to+'] cannot be greater than the maximum range['+(arraylength)+'].');highlight('#to', '#BA4027');}
						else if(to < from){alert('Range error! End range['+to+'] cannot be less than the Start range['+from+'].');highlight('#to', '#BA4027');}
						else{
							for (i = from-1; i < to; i++){
								improvement += Database[product][parameter][M_n][i][0];
								stepcostTotal += Database[product][parameter][M_n][i][1];
								speedupTotal += Database[product][parameter][M_n][i][2];
							}
							stepcostTotal *= stepdiscount; speedupTotal *= speedupdiscount;
							appendResultsBoolean = true;
						}
					}
				break;
			}
	}
}
