var alignElement = function(element, parent, argument){
	argument['orientation'] = argument['orientation'] || 'vertical';
	argument['alignment'] = argument['alignment'] || 'center';
	if (argument['orientation'] === 'horizontal') {
		var elementWidth = $(element).width();var parentWidth = $(parent).width();
		switch (argument['alignment']){
			case 'top':
				$(element).css({'margin-left': 0});
			break;
			case 'right':
				$(element).css({'margin-left': (parentWidth - elementWidth)});
			break;
			case 'center':
				$(element).css({'margin-left': ((parentWidth - elementWidth)/2)});
			break;
		}
	}else if (argument['orientation'] === 'vertical') {
		var elementHeight = $(element).height();var parentHeight = $(parent).height();
		switch (argument['alignment']){
			case 'top':
				$(element).css({'margin-top': 0});
			break;
			case 'bottom':
				$(element).css({'margin-top': (parentHeight - elementHeight)});
			break;
			case 'center':
				$(element).css({'margin-top': ((parentHeight - elementHeight)/2)});
			break;
		}
	}
}
