var numberArray = function(str, character) {
	var count = 1;
	while (str.indexOf(character) > -1) {
		count++;
		str = str.replace(character, '],/**' + parseInt(count) + '**/[');
	}
	str = '[/**1**/['+str+']]'
	return str;
}
//scroll('#element', [0, 500], {vertical: 'enabled',horizontal: 'enabled', adoptcss: true, thumb: '#scrollThumbID', track: '#scrollTrackID'})
var scroll = function(target, bounds, argument){
	var mdown = false;
	var mdownInitialX = 0;
	var mdownInitialY = 0;
	var scrollInitialMarginX = 0;
	var scrollInitialMarginY = 0;
	var scrollMovingMargin = 0;
	var scrollWidth = 0;
	var scrollHeight = 0;
	
	bounds[0] = 0;
	
	var scrollincrementincrease = 0;
	if (argument['adoptcss'] === true){
		$(argument['thumb']).css('position', 'relative')
	}
	if ((argument['horizontal'] === 'enabled')&&(argument['vertical'] === 'enabled')){
		$(argument['thumb']).draggable()
	}else{
		$(argument['thumb']).mousedown(function(e){
			e.preventDefault();
			mdown = true;
			mdownInitialY = e.pageY;
			scrollInitialMarginY = parseInt($(argument['thumb']).css('margin-top'));
			scrollHeight = $(argument['thumb']).height();
			mdownInitialX = e.pageX;
			scrollInitialMarginX = parseInt($(argument['thumb']).css('margin-left'));
			scrollWidth = $(argument['thumb']).width();
		})
		$('html').mousemove(function(e){
			if (mdown){
				e.preventDefault()
				if (argument['vertical'] === 'enabled'){
					scrollincrementincrease = ((($(target).height())-$(argument['track']).height())/(($(argument['track']).height())-scrollHeight));
					bounds[1] = $(argument['thumb']).parent().height() - $(argument['thumb']).height();
					$(argument['thumb']).css('margin-top',scrollInitialMarginY +e.pageY - mdownInitialY+'px');
					scrollMovingMargin = parseInt($(argument['thumb']).css('margin-top'))
					if (scrollMovingMargin < bounds[0]){
						$(argument['thumb']).css('margin-top', bounds[0]+'px');
					}else if (scrollMovingMargin > bounds[1]){
							$(argument['thumb']).css('margin-top', bounds[1]+'px');
					}else{
						$(target).css('margin-top', (scrollincrementincrease*(-1*scrollMovingMargin))+'px')
					}
				}else if (argument['horizontal'] === 'enabled'){
					scrollincrementincrease = ((($(target).width())-$(argument['track']).width())/(($(argument['track']).width())-scrollWidth));
					bounds[1] = $(argument['thumb']).parent().width() - $(argument['thumb']).width();
					$(argument['thumb']).css('margin-left',scrollInitialMarginX +e.pageX - mdownInitialX+'px');
					scrollMovingMargin = parseInt($(argument['thumb']).css('margin-left'));
					if (scrollMovingMargin < bounds[0]){
						$(argument['thumb']).css('margin-left', bounds[0]+'px');
					}else if (scrollMovingMargin > bounds[1]){
							$(argument['thumb']).css('margin-left', bounds[1]+'px');
					}else{
						//Make use of scroll here -- scrollMovingMargin
					}
				}
			}
		})
		$('html').mouseup(function(e){
			if (mdown){
				e.preventDefault();
				mdown = false;
			}
		})
	}
}